import React from 'react';
import { View } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import { useNavigationState } from '@react-navigation/native';
import { Ionicons } from '@expo/vector-icons';
import HomeScreen from '../screens/main/HomeScreen';
import CombinedIssuesScreen from '../screens/main/CombinedIssuesScreen';
import AlertsScreen from '../screens/main/AlertsScreen';
import ProfileScreen from '../screens/main/ProfileScreen';
import ComplaintWizardScreen from '../screens/main/ComplaintWizardScreen';
import DepartmentScreen from '../screens/main/DepartmentScreen';
import ReportsScreen from '../screens/main/ReportsScreen';
import TrackIssueScreen from '../screens/main/TrackIssueScreen';
import SwipeableBottomTabNavigator from '../components/SwipeableBottomTabNavigator';

const Tab = createBottomTabNavigator();
const Stack = createStackNavigator();

const HomeStack = () => (
  <Stack.Navigator>
    <Stack.Screen 
      name="HomeMain" 
      component={HomeScreen} 
      options={{ headerShown: false }}
    />
    <Stack.Screen 
      name="Complaint" 
      component={ComplaintWizardScreen}
      options={{ title: 'Report Issue' }}
    />
    <Stack.Screen 
      name="Department" 
      component={DepartmentScreen}
      options={{ title: 'Department Issues' }}
    />
    <Stack.Screen 
      name="Reports" 
      component={ReportsScreen}
      options={{ title: 'My Reports' }}
    />
    <Stack.Screen 
      name="TrackIssue" 
      component={TrackIssueScreen}
      options={{ title: 'Track Issue' }}
    />
  </Stack.Navigator>
);

// Tab configuration for swipeable bottom navigator
const tabs = [
  {
    key: 'home',
    title: 'Home',
    icon: 'home',
    component: HomeStack,
  },
  {
    key: 'issues',
    title: 'Issues',
    icon: 'list',
    component: CombinedIssuesScreen,
  },
  {
    key: 'alerts',
    title: 'Alerts',
    icon: 'notifications',
    component: AlertsScreen,
  },
  {
    key: 'profile',
    title: 'Profile',
    icon: 'person',
    component: ProfileScreen,
  },
];

// Create component outside to avoid inline function warning
const SwipeableTabsScreen = () => (
  <SwipeableBottomTabNavigator tabs={tabs} initialTab={0} />
);

const MainNavigator = () => {
  return (
    <Tab.Navigator
      screenOptions={() => ({
        headerShown: false,
        tabBarStyle: { display: 'none' }, // Hide default tab bar
      })}
    >
      <Tab.Screen 
        name="SwipeableTabs" 
        component={SwipeableTabsScreen}
      />
    </Tab.Navigator>
  );
};

export default MainNavigator;
